      </label>
      <br />
      <input type="text" cols="30" width={width} height={height} />
      <br />
      <label htmlFor="" font={font} color={color} fontSize={fontSize}>
        Notes
      </label>
      <br />
      <textarea name="textarea" id="textarea" cols="30" rows="10"></textarea>
    </form>
  );
}

